webpackJsonp([53681874159575],{9032:function(e,a){e.exports={pathContext:{group:[{node:{fields:{title:"PapaScott Hacked",date:"27 May 2002",slug:"/2002-05-27-papascott-hacked/",tags:"Y2002"},html:'<p>If you use Movable Type, make sure you read <a href="http://www.movabletype.org/news/2002_05_26.shtml#000297">this</a>, and double check that your mt-load.cgi has <i>really</i> been deleted. Even if you know you deleted it, double check... you might have inadvertantly copied it over when upgrading, like I did. I got hit. All my user ids were deleted, and I was unable to log in.</p>'},next:{fields:{title:"Royal MT Hacks",date:"26 May 2002",slug:"/2002-05-26-royal-mt-hacks/"}},previous:{fields:{title:"PHP blo.gs blogroll",date:"27 May 2002",slug:"/2002-05-27-php-blogs-blogroll/"}}},{node:{fields:{title:"Royal MT Hacks",date:"26 May 2002",slug:"/2002-05-26-royal-mt-hacks/",tags:"Y2002"},html:'<p><a href="http://www.royal-ts.de/">RoyalTS - without cheese</a> has a new design, which I wouldn\'t otherwise mention. But he has a <a href="http://www.royal-ts.de/mtarchives/000734.php#000734">list of of MT hacks</a> he applied, so I have to make a note for myself! And I had to see if pinging <a href="http://blo.gs">blo.gs</a> really worked.</p>'},next:{fields:{title:"Happy Region Code Day",date:"26 May 2002",slug:"/2002-05-26-happy-region-code-day/"}},previous:{fields:{title:"PapaScott Hacked",date:"27 May 2002",slug:"/2002-05-27-papascott-hacked/"}}},{node:{fields:{title:"Happy Region Code Day",date:"26 May 2002",slug:"/2002-05-26-happy-region-code-day/",tags:"Y2002"},html:'<p>I\'m happy. <a href="http://www.veseg.de/">SEG</a> has released new firmware for my Hollywood II DVD player that makes the region code setting configurable. I can now watch those DVDs I picked up in the States on my last couple of trips. Mama will be overjoyed (actually not; she and I don\'t have the same taste in movies).</p>\n<p><b>Update:</b> If you can read German, <a href="http://www.dvdboard.de/forum/showthread.php?postid=228883#post228883">this entry</a> at dvdboard.de gives the details on changing the region setting.</p>'},next:{fields:{title:"Grand Prix Night",date:"25 May 2002",slug:"/2002-05-25-grand-prix-night/"}},previous:{fields:{title:"Royal MT Hacks",date:"26 May 2002",slug:"/2002-05-26-royal-mt-hacks/"}}}],pathPrefix:"",first:!1,last:!1,index:893,pageCount:1101}}}});
